void togcj_table(float x, float y, float *xout, float *yout)
{
	long i, j;
	float x1, y1, x2, y2, x3, y3, x4, y4, xtry, ytry;
	float t, u;


	xtry = x;
	ytry = y;


	if( xtry < 72 || xtry > 137.9 || ytry < 10 || ytry > 54.9)
	{
		*xout=x;
		*yout=y;
		return;
	}

	i = (long) ((xtry - 72.0) * 10.0)/PRECISION;
	j = (long) ((ytry - 10.0) * 10.0)/PRECISION;


	x1 = m_TableX[ID(i, j)];
	y1 = m_TableY[ID(i, j)];
	x2 = m_TableX[ID(i+1, j)];
	y2 = m_TableY[ID(i+1, j)];
	x3 = m_TableX[ID(i+1, j+1)];
	y3 = m_TableY[ID(i+1, j+1)];
	x4 = m_TableX[ID(i, j+1)];
	y4 = m_TableY[ID(i, j+1)];

	t = (xtry - 72.0 - 0.1*PRECISION * i) /(0.1*PRECISION);
	u = (ytry - 10.0 - 0.1*PRECISION * j) /(0.1*PRECISION);


	xtry = (1.0-t)*(1.0-u)*x1 + t*(1.0-u)*x2 + t*u*x3 + (1.0-t)*u*x4 ;
	ytry = (1.0-t)*(1.0-u)*y1 + t*(1.0-u)*y2 + t*u*y3 + (1.0-t)*u*y4 ;

	*xout = xtry;
	*yout = ytry;
	//  printf("%f %f -> %f %f\n", x, y, *xout, *yout);

	return;
}
